# https://sparql.uniprot.org/sparql
PREFIX up: <http://purl.uniprot.org/core/>
PREFIX gly: <http://purl.obolibrary.org/obo/GlycoConnect#>

SELECT DISTINCT ?enzyme ?glycosylationSite ?glycan
WHERE {
  SERVICE <https://sparql.uniprot.org/sparql> {
    ?enzyme a up:Protein ;
            up:organism <http://purl.uniprot.org/taxonomy/9606> ;
            up:annotation ?annotation .
    ?annotation a up:Modified_Residue_Annotation ;
                up:range ?range .
    FILTER CONTAINS(STR(?annotation), "glycosylation")
    ?range up:start ?glycosylationSite .
  }
